import React, { Component } from 'react';   

import '../styles/Foundations.css';

import Nav from '../components/Nav';

class Foundations extends Component {
    constructor(props) {
        super(props);
    }
    return() {
        return (
            <React.Fragment>
                <Nav color="black"/>

                <div classNames="foundations-intro-container">
                    <h1>hello</h1>
                </div>
            </React.Fragment>
        );
    }

}

export default Foundations;
